items.body:
I am trying to perform a simple table create using the code:

```
client = get_client(json_key_file=key)
exists = client.check_table(dataset, tablename)
if not exists:
    created = client.create_table(dataset, tablename, schema)
    if not created:
        sys.exit('Error creating table')
```

I see the `check_table` method returning correctly, but but on `create_table`, I am getting the error response on the HTTP call.
```
{
  "error": {
    "code": 403,
    "message": "Request had insufficient authentication scopes.",
    "errors": [
      {
        "message": "Request had insufficient authentication scopes.",
        "domain": "global",
        "reason": "forbidden"
      }
    ],
    "status": "PERMISSION_DENIED"
  }
}
```

I have created a Google IAM **service-account** with the roles `Project->Owner` *and* `BigQuery->BigQuery Admin`, and am referencing that service accounts `.json` credential files.

Does anyone know where I am gong wrong here? To me, this all looks correct, and I've been pulling my hair out for a while over this. Why would a table check call work, but a table create call be unauthorized?
